import web from "../images/web.jpeg";
import web1 from "../images/web1.jpeg";
import web3 from "../images/web3.jpeg";
import web4 from "../images/web4.jpeg";
import soft from "../images/soft.jpeg";
import marketing from "../images/marketing.jpeg";
import developer from "../images/developer.jpeg";
import app from "../images/app.jpeg";
const Sdata = [
    {
        imgsrc:web,
        title:"web development",
    },
    {
        imgsrc:web1,
        title:"web development",
    },

    {
        imgsrc:web3,
        title:"web development",
    },
   
    {
        imgsrc:web4,
        title:"web development",
    },

    
    {
        imgsrc:soft,
        title:"software development",
    },
    {
        imgsrc:marketing,
        title:"product marketinng",
    },

    {
        imgsrc:developer,
        title:"web development",
    },

    {
        imgsrc:app,
        title:"App developer",
    }
]

export default Sdata;
